package com.zaritcare.data.mocks.emotion

import javax.inject.Inject

class EmotionDaoMock @Inject constructor() {
    private val smilePhoto: String = ""
    private val sadPhoto: String = ""
    private val upsetPhoto: String = ""
    private val angryPhoto: String = ""
    private val sickPhoto: String = ""

    private val emotions = mutableListOf<EmotionMock>(
        EmotionMock(
            id = 1,
            name = "Feliz",
            image = smilePhoto
        ),
        EmotionMock(
            id = 2,
            name = "Triste",
            image = sadPhoto
        ),
        EmotionMock(
            id = 3,
            name = "Decepcionado",
            image = upsetPhoto
        ),
        EmotionMock(
            id = 4,
            name = "Enfadado",
            image = angryPhoto
        ),
        EmotionMock(
            id = 5,
            name = "Enfermo",
            image = sickPhoto
        )
    )

    fun get(): List<EmotionMock> = emotions
    fun count() = emotions.size
    fun get(name: String): EmotionMock = emotions.first { emotion -> emotion.name == name }
    fun get(id: Int): EmotionMock? = emotions.find { emotion -> emotion.id == id }
}